import styled from "../assets/styles";


export const Header = styled.header`
    display: flex;
    align-items: center;
    h1 {
        position: absolute;
        font-family: Montserrat;
        font-style: normal;
        font-weight: 800;
        font-size: 48px;
        text-align: center;
        color: #88DEAF;


    }
    h3 {
        color: white;
    }

`
